import './features.css';

const Features = () => {
	return (
		<div className="omntech__features section__padding" id="features">
			<div className="omntech__features-heading">
				<h1 className="gradient__text">The Future is Now and You Just Need To Realize It. Step into Future Today & Make it Happen.</h1>
				<p></p>
			</div>
		</div>
	)
}

export default Features
